import React from 'react';

const LayerLibrary: React.FC = () => {
    const layerTypes = [
        { type: 'InputLayer', name: 'Input Layer' },
        { type: 'Conv2DLayer', name: 'Conv2D Layer' },
        { type: 'OutputLayer', name: 'Output Layer' },
        { type: 'ConcatLayer', name: 'Concat Layer' },
    ];

    const handleDragStart = (e: React.DragEvent, layerType: string) => {
        e.dataTransfer.setData('text/plain', JSON.stringify({
            type: layerType,
            id: Date.now(), // Simple ID generation
        }));
    };

    return (
        <div style={{ width: 200, border: '1px solid #ccc', padding: 16, background: '#f5f5f5' }}>
            <h3>Layer Library</h3>
            {layerTypes.map((layer) => (
                <div
                    key={layer.type}
                    draggable
                    onDragStart={(e) => handleDragStart(e, layer.type)}
                    style={{
                        padding: 8,
                        margin: '8px 0',
                        background: '#fff',
                        border: '1px solid #ddd',
                        borderRadius: 4,
                        cursor: 'grab',
                    }}
                >
                    {layer.name}
                </div>
            ))}
        </div>
    );
};

export default LayerLibrary;
